import React from 'react';
import {Header} from './components/Header';
import {Footer} from './components/Footer';



export default function Layout(props) {
	return (
		<React.Fragment>
			<Header coins={props.coins}/>
			{props.children}
      <Footer/>
		</React.Fragment>
	)
}
